import React, { useState, useEffect } from "react";
import axios from "axios";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  LineElement,
  CategoryScale,
  LinearScale,
  PointElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(LineElement, CategoryScale, LinearScale, PointElement, Title, Tooltip, Legend);

const Predictions = () => {
  const [predictions, setPredictions] = useState([]);
  const [confusionMatrix, setConfusionMatrix] = useState([]);
  const [classificationReport, setClassificationReport] = useState({});
  const [latestPrediction, setLatestPrediction] = useState("");
  const [accuracy, setAccuracy] = useState(0);

  useEffect(() => {
    axios
      .get("https://meto-backend.onrender.com/predictions")
      .then((response) => {
        const { predictions, confusion_matrix, classification_report, latest_prediction, accuracy } = response.data;
        setPredictions(predictions);
        setConfusionMatrix(confusion_matrix);
        setClassificationReport(classification_report);
        setLatestPrediction(latest_prediction);
        setAccuracy(accuracy);
      })
      .catch((error) => {
        console.error("Error fetching predictions:", error);
      });
  }, []);

  const chartData = {
    labels: predictions.map((_, index) => index + 1),
    datasets: [
      {
        label: "Heart Rate",
        data: predictions,
        fill: false,
        borderColor: "#06b6d4",
        backgroundColor: "#06b6d4",
        tension: 0.3,
        pointRadius: 3,
      },
    ],
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: { position: "top" },
      title: { display: true, text: "Heart Rate Trend" },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: { display: true, text: "Heart Rate" },
      },
      x: {
        title: { display: true, text: "Sample Index" },
      },
    },
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <div className="max-w-6xl mx-auto bg-white shadow-2xl rounded-2xl p-8 space-y-8">
        <h1 className="text-4xl font-bold text-center text-gray-800">Heart Rate Prediction (CSV)</h1>

        <div className="text-center space-y-2">
          <p className="text-xl font-medium">Latest Prediction:
            <span className="text-indigo-600 font-semibold ml-2">{latestPrediction}</span>
          </p>
          <p className="text-md">Model Accuracy:
            <span className="text-green-600 font-semibold ml-2">{(accuracy * 100).toFixed(2)}%</span>
          </p>
        </div>

        <div className="grid md:grid-cols-2 gap-6">
          <div className="bg-gray-50 p-4 rounded-xl shadow-lg">
            <Line data={chartData} options={chartOptions} />
          </div>

          <div className="bg-gray-50 p-4 rounded-xl shadow-lg text-center">
            <h2 className="text-xl font-semibold mb-4 text-gray-700">Confusion Matrix</h2>
            <div className="inline-grid grid-cols-3 gap-2">
              {confusionMatrix.flat().map((val, i) => (
                <div
                  key={i}
                  className="bg-blue-100 text-blue-800 font-semibold px-4 py-2 rounded shadow-sm"
                >
                  {val}
                </div>
              ))}
            </div>
          </div>
        </div>

        <div className="bg-gray-50 p-4 rounded-xl shadow-lg">
          <h2 className="text-xl font-semibold mb-4 text-center text-gray-700">Classification Report</h2>
          <div className="overflow-x-auto">
            <table className="w-full table-auto border border-gray-200 rounded-lg">
              <thead className="bg-gray-100 text-gray-700 text-left">
                <tr>
                  <th className="px-4 py-2 border">Label</th>
                  <th className="px-4 py-2 border">Precision</th>
                  <th className="px-4 py-2 border">Recall</th>
                  <th className="px-4 py-2 border">F1-Score</th>
                </tr>
              </thead>
              <tbody>
                {Object.entries(classificationReport)
                  .filter(([label]) => !["accuracy", "macro avg", "weighted avg"].includes(label))
                  .map(([label, scores]) => (
                    <tr key={label} className="hover:bg-gray-50">
                      <td className="px-4 py-2 border">{label}</td>
                      <td className="px-4 py-2 border">{(scores.precision * 100).toFixed(2)}%</td>
                      <td className="px-4 py-2 border">{(scores.recall * 100).toFixed(2)}%</td>
                      <td className="px-4 py-2 border">{(scores["f1-score"] * 100).toFixed(2)}%</td>
                    </tr>
                  ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Predictions;
